window.bookSummaryJSON = "<p><b>[Last Time in Multiverse Z!] The Multiverse Crawlers slayed three major Demon Rulers back to back after paying a heavy price.</b></p> <p>No Oasis City is one of the few bastions of civilization in Beautiful Hell. It's also a playground for Joey and Maylolee Eclipse, who are obviously the most powerful duo there.</p> <p>During the day, they take on crime and corruption like they were born for it. At night, they delve deep into the underground caverns and practice with a breadth of powers they shouldn't have. All as preparation for completing their Master Quest to slay the 72 Demons and finally take over the Beautiful Hell Plane.</p> <p>Then the city turns against them.</p> <p>Follow Joey and Maylolee for another action-packed adventure where they unearth secret lairs and dungeons and face the last demons of Beautiful Hell. See them push beyond their limits, max out their levels, gain new legendary spells, and finally advance their cultivation to the next tier.</p> <p>What they will become is greater and stronger than they could've ever imagined.</p> <p>This will conclude the end of the Beautiful Hell Arc and the start of a new beginning.</p> <p>[Welcome back to Multiverse Z!]</p> <p>[Now let's continue the show!]</p>"; 
